import{_ as o}from"./chunks/relate-demo.63JtzhOZ.js";import{_ as t,c as d,o as a,ag as n}from"./chunks/framework.ifgpkas4.js";const N=JSON.parse('{"title":"Core Data Types","description":"","frontmatter":{},"headers":[],"relativePath":"en/overview/data.md","filePath":"en/overview/data.md"}'),c={name:"en/overview/data.md"};function r(i,e,s,p,h,l){return a(),d("div",null,e[0]||(e[0]=[n('<h1 id="core-data-types" tabindex="-1">Core Data Types <a class="header-anchor" href="#core-data-types" aria-label="Permalink to &quot;Core Data Types&quot;">​</a></h1><h2 id="_0-overview" tabindex="-1">0. Overview <a class="header-anchor" href="#_0-overview" aria-label="Permalink to &quot;0. Overview&quot;">​</a></h2><p>If the following data needs to be created:</p><p><img src="'+o+'" alt="relate-demo"></p><p>Assuming there are 4 components in the graph divided into three types, where B and C are of the same type.</p><p>The process of creating core data is as follows:</p><ul><li><p>First, create 3 <code>NodeProto</code> corresponding to</p><ul><li>Component A (named protoA)</li><li>Components B and C (named protoBC)</li><li>Component D (named protoD)</li></ul></li><li><p>Second, create <code>Port</code>. According to the relationships in the graph, it can be seen that protoA has one input port and two output ports, so create portA1 as an INPUT type port for protoA, and then create portA2 and portA3 as OUTPUT type ports. Similarly, create ports for protoBC and protoD in the same way.</p></li><li><p>Third, create <code>Node</code>. Create NodeA, NodeB, NodeC, and NodeD corresponding to the four nodes in the graph. When creating them, only the associated <code>NodeProto</code> needs to be passed in.</p></li><li><p>Fourth, create <code>Edge</code>. According to the relationships in the graph, it can be seen that the <code>Edge</code> connecting NodeA and NodeB has a starting position of <code>NodeA</code>+<code>portA2</code> and an ending position of <code>NodeB</code>+<code>portB1</code>. Use these two positions to create an <code>Edge</code>, and other <code>Edges</code> are created in the same way.</p></li></ul><h2 id="_1-node-template-nodeproto" tabindex="-1">1. Node Template NodeProto <a class="header-anchor" href="#_1-node-template-nodeproto" aria-label="Permalink to &quot;1. Node Template NodeProto&quot;">​</a></h2><blockquote><p>Necessary data to create a <code>NodeProto</code>: name, width, height, unique id.</p></blockquote><p><code>NodeProto</code> is a template for <code>node</code>. Nodes from the same <code>NodeProto</code> have the same <code>Port</code> and the order of these <code>Ports</code> is also the same.</p><p><code>NodeProto</code> is an abstract concept but needs to be defined by the user.</p><h2 id="_2-node-instance-node" tabindex="-1">2. Node Instance Node <a class="header-anchor" href="#_2-node-instance-node" aria-label="Permalink to &quot;2. Node Instance Node&quot;">​</a></h2><blockquote><p>Necessary data to create a <code>Node</code>: id of the associated <code>NodeProto</code>, name, unique id.</p></blockquote><p><code>Node</code> is generated based on <code>NodeProto</code>. Each <code>Node</code> corresponds to a node instance in the final graph data.</p><h2 id="_3-connection-port-port" tabindex="-1">3. Connection Port Port <a class="header-anchor" href="#_3-connection-port-port" aria-label="Permalink to &quot;3. Connection Port Port&quot;">​</a></h2><blockquote><p>Necessary data to create a <code>Port</code>: id of the associated <code>NodeProto</code>, name, <code>Port</code> type, unique id.</p></blockquote><p><code>Port</code> is the port data mounted on <code>NodeProto</code>. The <code>Port</code> type can be INPUT or OUTPUT.</p><p>INPUT type <code>Ports</code> can only be used as the destination of an <code>Edge</code>, and OUTPUT type <code>Ports</code> can only be used as the source of an <code>Edge</code>.</p><p>INPUT type <code>Ports</code> are fixed on the left side of <code>NodeProto</code>, and OUTPUT type <code>Ports</code> are fixed on the right side of <code>NodeProto</code>.</p><h2 id="_4-connection-relationship-edge" tabindex="-1">4. Connection Relationship Edge <a class="header-anchor" href="#_4-connection-relationship-edge" aria-label="Permalink to &quot;4. Connection Relationship Edge&quot;">​</a></h2><blockquote><p>Necessary data to create an <code>Edge</code>: starting <code>Node</code> pointer or id, starting <code>Port</code> pointer or id, ending <code>Node</code> pointer or id, ending <code>Port</code> pointer or id.</p></blockquote><p><code>Edge</code> is the connection between two <code>Node</code> + <code>Port</code>, representing the connection relationship between two <code>Ports</code> in the graph data.</p><p>After the algorithm is executed, an <code>Edge</code> will consist of one or more line segments parallel to the X-axis or Y-axis.</p><div class="warning custom-block"><p class="custom-block-title">Why does Edge need to associate both Node and Port?</p><p><code>Port</code> data is associated with <code>NodeProto</code>, and <code>NodeProto</code> is an abstract concept that cannot correspond to the final node in the graph data.</p><p>Therefore, an instance of a <code>Port</code> in the graph data needs the data of <code>Node</code> + <code>Port</code> for positioning.</p><p>Since <code>Edge</code> needs to be represented in the graph data, the starting and ending Ports it associates with also need the data of <code>Node</code> + <code>Port</code> for positioning.</p></div>',24)]))}const m=t(c,[["render",r]]);export{N as __pageData,m as default};
